import React, { useState } from 'react';
import { Carousel } from 'react-bootstrap';
import '../CSS/carousel.css';

const CarouselContainer = (props) => {
  const [truee, settruee] = useState(false);
  const carouseleHandler = (e) => {
    console.log('clicked');
    settruee(!truee);
    props.hand(truee);
  };

  return (
    <Carousel
      fade={true}
      pause={false}
      prevIcon={<span aria-hidden="true" />}
      nextIcon={<span aria-hidden="true" />}
    >
      <Carousel.Item interval={2000}>
        <img
          className="d-block w-100"
          src="https://isabelprojects.s3.amazonaws.com/proyectouri/Logos/Uri-1.jpg"
          alt="First slide"
        />

        <Carousel.Caption>
          <h3 className="corh3">Uri</h3>
          <button onClick={carouseleHandler}>Get Started</button>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item interval={2000}>
        <img
          className="d-block w-100"
          src="https://isabelprojects.s3.amazonaws.com/proyectouri/Logos/URI%20SHOT%20EDIT%20URI%20FONDONEGRO.jpg"
          alt="Second slide"
        />
      </Carousel.Item>
      <Carousel.Item interval={2000}>
        <img
          className="d-block w-100"
          src="https://isabelprojects.s3.amazonaws.com/proyectouri/Logos/Uri-2.jpg"
          alt="Third slide"
        />
      </Carousel.Item>
    </Carousel>
  );
};
export default CarouselContainer;
